import React from 'react';

export default function Menu(props) {

  const options = props.options.map((option, index) => (
    <li 
      key={index} 
      className="meals"
      onMouseOver={() => {
        document.getElementById(`y-${option}`).classList.add("selected")
      }}
      onMouseOut={() => {
        document.getElementById(`y-${option}`).classList.remove("selected")
      }}>
        <div className="example-picture"></div>
        <p>{option}</p>
    </li>
  ))
  

  return (
    <ul>
        <li className="meals">
            <div className="example-picture"></div>
            <p>Pork Dumplings</p>
        </li>
        <li className="meals">
            <div className="example-picture"></div>
            <p>Mexican Pizza</p>
        </li>
        <li className="meals">
            <div className="example-picture"></div>
            <p>Bruschetta Chicken Pasta Bowl from Olive Garden</p>
        </li>
        <li className="meals"><div className="example-picture"></div><p>Quinoa</p></li>
    </ul>
  );
}
